Hello! My name is George Fahmy and I'm building a Van's Aircraft RV-7 &nbsp;and I'll be documenting my build on this website! Its going to definitely be a big project, but I think I should be able to handle it.&nbsp;

My callsign N890GF is a combination of my birth month/year/initials. I spent a long time debating what I wanted as my callsign, and after repeating this out loud over and over again, it just rolls of the tongue and thats when I reserved it with the FAA!

Ever since I was a young boy I knew I was going to be an engineer, I was drawn to taking things apart and putting them back together. I started flying remote control planes early on in life and when I got to college I began studying Aerospace Engineering. I also continued flying remote control planes and they kept getting bigger and bigger. When I graduated college and got my first job, I decided to pursue my pilots license and on March 16th 2016 I passed my checkride and became a Private Pilot! My dream of flying has become a reality, now I am trying to fulfill the other half of that dream which is to fly a plane I built myself.&nbsp;

I can't wait to get to that point, but until then I'm glad to share my progress and this experience with everyone!&nbsp;

-George

Today was a big day, I spent about 8 hours on the stab. &nbsp;

<a href="https://n890gf.com/wp-content/uploads/2015/11/img_2452.jpg"><img src="https://n890gf.com/wp-content/uploads/2015/11/img_2452.jpg" alt=""></a>&nbsp;
I finished smoothing out the front spar reinforcing bars and match drilling everything to the spars, along with the spar doublers.&nbsp;

&nbsp;<a href="https://n890gf.com/wp-content/uploads/2015/11/img_2454-0.jpg"><img src="https://n890gf.com/wp-content/uploads/2015/11/img_2454-0.jpg" alt=""></a>&nbsp;
I then clecoed the Stab skeleton together, match drilled the rib holes to the spars and deburred the holes. &nbsp;

<a href="https://n890gf.com/wp-content/uploads/2015/11/img_2461-0.jpg"><img src="https://n890gf.com/wp-content/uploads/2015/11/img_2461-0.jpg" alt=""></a>&nbsp;<a href="https://n890gf.com/wp-content/uploads/2015/11/img_2462.jpg"><img src="https://n890gf.com/wp-content/uploads/2015/11/img_2462.jpg" alt=""></a>&nbsp;
I then managed to get the skin all clecoed on to the frame, that was super hard to get it flush with the ribs, the aluminum is under-bent when it's shipped.&nbsp;

&nbsp;<a href="https://n890gf.com/wp-content/uploads/2015/11/img_2467.jpg"><img src="https://n890gf.com/wp-content/uploads/2015/11/img_2467.jpg" alt=""></a>&nbsp;
I then clamped and marked the hole positions for the remaining spar holes and the inner ribs that have to be drilled to match the skin.&nbsp;

Overall it was a productive day, I'm still getting the hang of the part naming convention and the drawing call-outs. It's only the second day, but I can see the progress which is a good sign!&nbsp;

Today I finished the assembly on the H-Stab, right side and left sides have been match drilled and are ready for dimpling.&nbsp;

