After what seems like a couple weeks of very little work on the plane, my uncle came over to help me out and we spent about 3 hours today doing some edge finishing and deburring and surface prep on the elevator stiffeners.&nbsp;

Once that was done I countersunk the holes for the plate-nuts and riveted them in place. This is the plate that holds the electric trim servo on, and I also fit the servo to the mounting brackets and the brackets to the mounting plate. Not too much to show, by the countersinking was spot on, ended up with perfectly flush rivets.&nbsp;

