I also put the berrings in and measured them to 13/16ths per the plans. Now on to the left elevator and trim tab

Tonight I spent about an hour on the vertical stab and rudder fiberglass tips. &nbsp;

<a href="https://n890gf.com/wp-content/uploads/2016/03/img_3546.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/03/img_3546.jpg" alt=""></a>&nbsp;
