Not much building has been going on the last couple weeks. After getting my license I've finally taken my first passenger up: my sister! It was a windy morning but it was a good first experience, it doesn't get much bumpier than what we were flying in. She flew like a champ though, held her lunch down, and had a fun time! I can't wait to take people flying in my own plane one day!&nbsp;

