Today I spent about 6 hours working on the wings and wing parts. I began by cutting the pushrods to length. I then primed and riveted the pushrod ends to the tubes.&nbsp;

<a href="https://n890gf.com/wp-content/uploads/2016/05/img_4389-1.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/05/img_4389-1.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-282"></a><a href="https://n890gf.com/wp-content/uploads/2016/05/img_4391-1.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/05/img_4391-1.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-284"></a><a href="https://n890gf.com/wp-content/uploads/2016/05/img_4393-1.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/05/img_4393-1.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-283"></a>I then installed them in the wings. The rod end bearings will be adjusted to the final length when everything gets put together. I also put the autopilot servo wiring harness through the wing. Earlier in the day I put two dsub9 connectors on and connected them together.&nbsp;

I also assembled the aileron attachment brackets.&nbsp;

<a href="https://n890gf.com/wp-content/uploads/2016/05/img_4388.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/05/img_4388.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-285"></a><a href="https://n890gf.com/wp-content/uploads/2016/05/img_4385.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/05/img_4385.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-286"></a>Here you can see them clecoed to the wings. The right wing brackets are also mounted to the wing. I'm going to hold off attaching them to the wing permanently so I can perform the latest service bulletin that Vans released. It will require some removal of the rivets, but it will be beneficial for safety.&nbsp;

Tonight I spent some time on the ailerons and flaps. Since I went with the quick build wings the aileron and flaps were all complete except a few things here and there. I started out by attaching the flap braces to the wings, I match drilled and deburred the edges and holes then blind riveted them to the rear spars.&nbsp;

<a href="https://n890gf.com/wp-content/uploads/2016/05/img_4394.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/05/img_4394.jpg" alt="" width="2448" height="3264" class="alignnone size-full wp-image-288"></a>These will get riveted to the bottom skin wth the flap hinge. Another difference between the slow build and quick build wings is that the flap brace gets blind rivets instead of solid rivets ( it's hard to get a bucking bar inside a closed up wing).&nbsp;

Next I got out the aileron attachment subkit and prepped and bolted the aileron attachment brackets to the aileron. I couldn't help myself but to attach it to the wing.&nbsp;

<a href="https://n890gf.com/wp-content/uploads/2016/05/img_4396.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/05/img_4396.jpg" alt="" width="2448" height="3264" class="alignnone size-full wp-image-289"></a>It's cool to see some more control surfaces going onto the plane. I haven't torqued anything fully because I will remove this several times during the fitting and alignment.&nbsp;

<a href="https://n890gf.com/wp-content/uploads/2016/05/img_4398.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/05/img_4398.jpg" alt="" width="2448" height="3264" class="alignnone size-full wp-image-290"></a>The aileron adds a nice amount of wing area, once I get some free time I'm going to pull out my old Aerospace Engineering books and see what kind of wing this is from a mathematical stand point. Very exciting to get more pieces together!&nbsp;

Tonight I pulled down the horizontal stab and fit the elevators to the stab. The final step in finishing the elevators required drilling the horns to the center bearing. I purchased a 1/4" OD drill bushing with a 3/32" ID. I then drilled #40 pilot holes in the horns and then stepped them up to 1/4 for the AN4 bolt.&nbsp;

<a href="https://n890gf.com/wp-content/uploads/2016/05/img_4408.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/05/img_4408.jpg" alt="" width="2448" height="3264" class="alignnone size-full wp-image-293"></a><a href="https://n890gf.com/wp-content/uploads/2016/05/img_4410.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/05/img_4410.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-292"></a>Here you can se the bolt at the base of the elevator horns. Once this was drilled the elevators swung freely with no binding in either direction. It was a smooth as butter!&nbsp;

<a href="https://n890gf.com/wp-content/uploads/2016/05/img_4411.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/05/img_4411.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-294"></a>I also took this time to cut the horn notches in the aft spar, this will get cleaned up and then reprimed. I also fit the fiberglass tips just to see what it looked like, I'm holding off on the fiberglass work until later.&nbsp;

<a href="https://n890gf.com/wp-content/uploads/2016/05/img_4405.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/05/img_4405.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-295"></a>The tail feathers look so good! Can't wait to fit this up to the fuse in the future! You can see the trim tab on the left elevator (the whole thing is upside down) it still needs to be slightly adjusted for the trim tab push rod from the servo, but other than little things here and there, the empennage is done!&nbsp;

Today was a busy day, I helped my mom move some old furniture down to her office, so I had to get a uhaul and load it up with everything. Fortunately it also included a bunch of stuff from the garage, so now I have nearly half the garage now cleaned. More room means easier to move around the fuse and wings.&nbsp;

A few days ago I had my friend help me out by welding the aileron pushrods. The manual calls for two aluminum rivets that hold the threaded steel bung to the steel tube. I didn't like the way it would have been held together and the aluminum holding the steel together doesn't bode well in my mind. The welding my buddy did is much much stronger and also looks cleaner than the rivets would have.&nbsp;

<a href="https://n890gf.com/wp-content/uploads/2016/05/img_4427.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/05/img_4427.jpg" alt="" width="1524" height="1143" class="alignnone size-full wp-image-297"></a>
Tonight I decided to rig up the ailerons, so I lined them up with the tooling holes in the end rib, and using the aileron bellcrank jig to line up the pushrods, I adjusted the lengths of the pushrods until everything fit perfectly. I disassembled them and set everything aside for now, I need to prime the pushrods again because the powdercoating had to be removed for welding.&nbsp;

I also received an order from Aircraft Spruce with some shielded wires and some snap bushings. I finished rigging up the pitot tube plumbing in the wing as well as the wiring for the wingtip lighting. I'm planning on going with full nav/strobe and landing lights in the wing tips with another strobe on the tail. But that's for much later in the build.&nbsp;

Today I decided to knock out the left flap hinges and rigging. I began by aligning the aileron using the bellcrank jig, and slotting a few bolts in the tooling holes in the main outboard rib.&nbsp;

<a href="https://n890gf.com/wp-content/uploads/2016/05/img_4438.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/05/img_4438.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-301"></a>Here's the jig installed along with the lower outboard skin clecoed to the wing. With this installed I was able to then align the flap to the aileron trailing edge.&nbsp;

<a href="https://n890gf.com/wp-content/uploads/2016/05/img_4439.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/05/img_4439.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-302"></a>Here you can see the flap hinge clecoed to the wing, the mark on the lower right side is a 1/4" mark along the whole hinge. In order to align the trailing edge of the aileron with the flap I had to raise the hinge and flap about 1/16 of an inch, after it was drilled it's perfectly aligned with the aileron.&nbsp;

<a href="https://n890gf.com/wp-content/uploads/2016/05/img_4440.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/05/img_4440.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-303"></a>Here you can see the flap hinge on the left clecoed to the wing, and the flap above. Everything will get final alignment before riveting, and then again when attaching the wings to the fuselage.&nbsp;

<a href="https://n890gf.com/wp-content/uploads/2016/05/img_4441.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/05/img_4441.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-304"></a>While I had the lower outboard skin clecoed on for the flap installation I decided to match drill the skin to the ribs and spars. There's a lot of rivets for this one skin. Now all that's left for this wing is to dimple this skin and the under-structure, but before I can rivet this I need to route a wire conduit for the wingtip lighting. It's a bundle of 4 shielded wires wth 10 or so wires inside.&nbsp;

Next up is the right wing.&nbsp;

Today I rigged up the remaining flap and lower wing skin on the right wing.&nbsp;

<a href="https://n890gf.com/wp-content/uploads/2016/05/img_4443.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/05/img_4443.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-306"></a>Here you can see the flap and aileron are perfectly aligned. The gap between the two is 1/64" under 1/4" but with final riveting of the flaps and when I rig the aileron I can increase that gap to at least 1/4".&nbsp;

<a href="https://n890gf.com/wp-content/uploads/2016/05/img_4444.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/05/img_4444.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-307"></a>Here's the shop with the lower wing skin on the right wing it's been match drilled to the structure.&nbsp;

<a href="https://n890gf.com/wp-content/uploads/2016/05/img_4445.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/05/img_4445.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-308"></a>Here's the flap drilled to the structure. It's perfectly aligned from the inboard to the outboard section of the flap.&nbsp;

<a href="https://n890gf.com/wp-content/uploads/2016/05/img_4447.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/05/img_4447.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-309"></a>I also rigged up The pitot tube mount. I fabricated a bracket that's clecoed to the rib. I decided to mount the pitot tube just outboard of the outboard access hatch. Some builders find this could interfere with the tiedown location (the small hole just above the square cutout). As long as I don't get careless with tieing down the plane it shouldn't be an issue.&nbsp;

<a href="https://n890gf.com/wp-content/uploads/2016/05/img_4451.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/05/img_4451.jpg" alt="" width="2448" height="3264" class="alignnone size-full wp-image-310"></a>Here you can see the bracket clecoed to the rib and Lito mount bracket. Here the pitot tube was installed temporarily.&nbsp;

<a href="https://n890gf.com/wp-content/uploads/2016/05/img_4450.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/05/img_4450.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-311"></a>The pitot tube mount can be removed from the plane with 4 screws that will install in dimples on the skin. This is incredibly strong as it is, but once I rivet the skin on it will be rock solid.&nbsp;

<a href="https://n890gf.com/wp-content/uploads/2016/05/img_4452.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/05/img_4452.jpg" alt="" width="2448" height="3264" class="alignnone size-full wp-image-312"></a>I also drilled and tapped the pitot tube for #6 screws to mount it flush with pitot tube mast.&nbsp;

With the empennage 99% complete (fiberglass work not done yet) I finally got some hooks up on the wall to get everything out of the way.&nbsp;

<a href="https://n890gf.com/wp-content/uploads/2016/06/img_4471.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/06/img_4471.jpg" alt="" width="2879" height="2448" class="alignnone size-full wp-image-314"></a>I also spent some time cleaning up the garage and getting things reorganized after I slacked a little and shop got a little messy. I then spent some time finishing up the pitot tube mounting provisions.&nbsp;

<a href="https://n890gf.com/wp-content/uploads/2016/06/img_4464.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/06/img_4464.jpg" alt="" width="2448" height="3264" class="alignnone size-full wp-image-315"></a>Here's the pitot tube mounting plate, the rivets on the side attach to an angle support that will get riveted to the rib.&nbsp;

<a href="https://n890gf.com/wp-content/uploads/2016/06/img_4465.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/06/img_4465.jpg" alt="" width="2448" height="3264" class="alignnone size-full wp-image-316"></a>Once I finished this I installed it in the wing. Currently there are no rivets that go through the wing skin into this plate except the ones that go through the spar. I may add more but the mounting screws hold the pitot mast and the whole installing is extremely rigid.&nbsp;

<a href="https://n890gf.com/wp-content/uploads/2016/06/img_4466.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/06/img_4466.jpg" alt="" width="2448" height="3264" class="alignnone size-full wp-image-317"></a>Even with the setup clecoed, the pitot tube is extremely rigid. I've flown many Skyhawks that have more movement in the pitot tubes by a factor of 10!&nbsp;

I also closed up the stall warning access plate (the hole behind the pitot tube)&nbsp;

<a href="https://n890gf.com/wp-content/uploads/2016/06/img_4469.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/06/img_4469.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-318"></a>The doubler plate is installed behind and held in by the clecoes, the cover plate is installed with screws into plate nuts that have been riveted to the doubler. The doubler has been match drilled, dimpled, deburred, and primed and can be installed at any time.&nbsp;

The Dynon pitot tube has angle of attack along with airspeed, which will indicate stall visually (on the EFIS) and audibly via my headset.&nbsp;

The wings are getting close to complete (or at least the majority of the work) and I will soon begin the work on the fuselage!&nbsp;

I got an order of ProSeal adhesive for my fuel tanks and did a bit a work on them today. I'm using the float type fuel level sensors and they need to be attached to the fuel tank access plate.&nbsp;<a href="https://n890gf.com/wp-content/uploads/2016/10/img_4911.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/10/img_4911.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-345"></a>

I attached the platenuts and then covered them with ProSeal, once those cured a bit I then attached the fuel level sensor with ProSeal between the plate and the sensor as well as around all the corners.&nbsp;<a href="https://n890gf.com/wp-content/uploads/2016/10/img_4912.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/10/img_4912.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-346"></a>

The screws were then covered with ProSeal and let to cure. Once I bond this to the tank it shouldn't be a source of any leaks (if there are any at all). This process was mirrored for both sides.&nbsp;<a href="https://n890gf.com/wp-content/uploads/2016/10/img_4916.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/10/img_4916.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-347"></a>

The float wire on the right side broke when I was bending it per the design spec so I need to call vans and see if they can send me a replacement. Otherwise, these will get installed soon. I still need to ProSeal the AN fitting for the fuel pickup. A bead of glue will go between the access plate and inboard rib when it's installed.&nbsp;

I also (finally) got the wing wire conduit installed. I went with a pvc conduit for its simplicity of installing in the QB wing.&nbsp;<a href="https://n890gf.com/wp-content/uploads/2016/10/img_4917.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/10/img_4917.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-348"></a>

It's held in by adel clamps attached to the ribs. I will also add a safety wire to each clamp to make sure it can't come loose.&nbsp;<a href="https://n890gf.com/wp-content/uploads/2016/10/img_4908.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/10/img_4908.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-349"></a>

This is the clamp that I modified to be able to attach to the rib. There are provisions for wiring a heated pitot tube if I decide to go that way, for right now it's unheated.&nbsp;

Hopefully work will slow down a bit in the near future and I can get more work done on the project. It's been far too long without time to work on it, till next time!&nbsp;

Had a little free time today so I finished the flap hinge modification.&nbsp;<a href="https://n890gf.com/wp-content/uploads/2016/10/img_4998.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/10/img_4998.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-353"></a>

Similar to what a lot of rv builders do, I cut out three of the loops and then bent the hinge pin at 90 deg. This allows the hinge pins to each the last loop on either end.&nbsp;<a href="https://n890gf.com/wp-content/uploads/2016/10/img_4997.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/10/img_4997.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-354"></a>

Not shown here but I took two loops from spare hinge material and will fabricate a bracket that will be screwed to the flap brace. Then repeat the same thing for the other wing.&nbsp;

Happy thanksgiving to my US friends! Today being a day off for us, I spent a few hours this morning in the garage.&nbsp;

I started by prepping and riveting the flap hinge on the remaining wing, the flaps are officially on! (Temporarily)<a href="https://n890gf.com/wp-content/uploads/2016/11/img_5079.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/11/img_5079.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-361"></a>

I then spent some time safety wiring my autopilot servo, it was a bit tricky and I had to redo it a few times. But I eventually got it!&nbsp;<a href="https://n890gf.com/wp-content/uploads/2016/11/img_5077.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/11/img_5077.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-362"></a>

It's not perfect, but it works. The wire will prevent any of the three bolts from backing out.&nbsp;<a href="https://n890gf.com/wp-content/uploads/2016/11/img_5078.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/11/img_5078.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-363"></a>

The end of it (top left in the image) will be out through a small hole im going to drill through the bracket. This will secure the final bolt.&nbsp;

I then spent some time removing the remaining fuel tank in preparation for sealing the access panel. I really hope I don't have to continuously remove and install it. It's very tedious work.&nbsp;<a href="https://n890gf.com/wp-content/uploads/2016/11/img_5081.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/11/img_5081.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-364"></a>

You can see on the left tank (right side) I have the pressure testing manometer hooked up. Once I seal the access panel to the tank, I will pressurize the tank up to 1psi or so and monitor the pressure to see if it's leaking. This can be the most nerve racking part because if there's a leak, it could be tough to find. Fingers crossed!&nbsp;

Until next time, Happy Thanksgiving!&nbsp;

I finished sealing the tanks about a week ago, and the last two days I spent leak testing them. I made a water manometer and pressurized the tank to about 20" of water. Over the course of 4 hours the tank pressure fluctuated a little, as the temperature rose in the garage the pressure went up slightly. I didn't bother doing the math to calculate the pressure rise, but it's safe to say if there was a leak it wouldn't go up. Just to be safe I also sprayed the whole tank with soapy water to see if bubbles formed. This actually cooled the tank down a bit as the cold water was sprayed on, and the pressure dropped down.&nbsp;<a href="https://n890gf.com/wp-content/uploads/2016/12/img_5128.jpg"><img src="https://n890gf.com/wp-content/uploads/2016/12/img_5128.jpg" alt="" width="2448" height="3264" class="alignnone size-full wp-image-369"></a>

This is the setup I did for both tanks. And both are rock solid. A big milestone under my belt and I'm glad it's over! I performed a similar test for the other tank and let it sit overnight. Again no drop in pressure and no bubbles formed at any point on the tank.&nbsp;

I then spent some time installing the tanks onto the wings, once they are installed there's only a couple more things to do to mark the wings done.&nbsp;
