	<li>Install wiring conduit in right wing</li>
	<li>Debur and install bottom skins</li>
	<li>Wing tips</li>
</ol>
3 and 4 will be pushed off until the very end of the build. There's no rush in installing the bottom skins as it's better to have access than to not. 1 and 2 should be a few hours work and then I'm done! Wings will be put into storage and then fuselage time.&nbsp;

