I started by drilling the holes in the motor arm to safety wire the bearing to the actuator. The motor uses a screw gear to raise and lower the flaps, and if this were to ever get loose it could back out entirely and the flaps would become loose. The safety wire prevents it from backing out.&nbsp;

I the m fabricated the motor mounting angle bracket. It's made from 0.063" angle stock.&nbsp;<a href="https://n890gf.com/wp-content/uploads/2017/05/img_0487.jpg"><img src="https://n890gf.com/wp-content/uploads/2017/05/img_0487.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-487"></a>

