Today I spent the day working on the center console and fuel pump and covers. I started by installing the heater baffle to the center floor cover.&nbsp;<a href="https://n890gf.com/wp-content/uploads/2017/09/img_2137.jpg"><img src="https://n890gf.com/wp-content/uploads/2017/09/img_2137.jpg" alt="" width="2448" height="3264" class="alignnone size-full wp-image-588"></a>

