I then installed the fuel selector valve and the fuel pump cover to figure out where it will align.&nbsp;<a href="https://n890gf.com/wp-content/uploads/2017/09/img_2136.jpg"><img src="https://n890gf.com/wp-content/uploads/2017/09/img_2136.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-589"></a>

Here’s the fuel pump cover in the left side attached to the fuel selector cover. I riveted these together and will make the pair removable as opposed to making them separate.&nbsp;

I then began experimenting with the fuel pump and the selector fuel line. I’m going with the Andair pump and filter, which is longer than the one from Vans. I tried to bend a fuel line from the selector to the fuel filter but it was not far enough back to fit under the cover. I ended up going with a side-by-side setup below.&nbsp;<a href="https://n890gf.com/wp-content/uploads/2017/09/img_2133.jpg"><img src="https://n890gf.com/wp-content/uploads/2017/09/img_2133.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-590"></a>

Fuel will come from the wings to the selector and then down through the filter and back to the pump. This will allow me plent of space to fit the pump under the cover which is marked by the black line on the left. The output of the fuel pump will route down under the cover and then forward to the firewall.&nbsp;

