Today I spent a few hours cleaning the shop and installing some fittings on the engine. My goal is to hang the engine next weekend.&nbsp;

I started by rotating the prop governor and installed the cable bracket.&nbsp;<a href="https://n890gf.com/wp-content/uploads/2017/10/img_2199.jpg"><img src="https://n890gf.com/wp-content/uploads/2017/10/img_2199.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-599"></a>

