I needed to install the oil cooler fittings, but that requires removing the right p-mag. Once off I could easily screw the fitting in.&nbsp;<a href="https://n890gf.com/wp-content/uploads/2017/10/img_2201.jpg"><img src="https://n890gf.com/wp-content/uploads/2017/10/img_2201.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-600"></a>

