Yesterday I hit a huge milestone. After many weeks of prep for this moment, I have officially installed my first airplane engine! It was more difficult than I thought, but everything lined up great once I figured out the technique.&nbsp;

First a huge thank you to my uncle for helping me out, definitely needed his strength and even one of his tools.

We began by repositioning the plane into the shade, and I propped the tail up on one of my saw horses to bring the nose down a bit.&nbsp;<a href="https://n890gf.com/wp-content/uploads/2017/10/img_2251.jpg"><img src="https://n890gf.com/wp-content/uploads/2017/10/img_2251.jpg" alt="" width="2448" height="3264" class="alignnone size-full wp-image-608"></a>

We then hoisted the engine and rolled it to the plane.&nbsp;<a href="https://n890gf.com/wp-content/uploads/2017/10/img_2252.jpg"><img src="https://n890gf.com/wp-content/uploads/2017/10/img_2252.jpg" alt="" width="2448" height="3264" class="alignnone size-full wp-image-609"></a>

It was a bit nerve wracking, but the hoist was pretty stable. <a href="https://n890gf.com/wp-content/uploads/2017/10/img_2255.jpg"><img src="https://n890gf.com/wp-content/uploads/2017/10/img_2255.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-610"></a>&nbsp;

The alignment process was quite tricky, and getting even one of the bolts to align took some wiggling and repositioning.&nbsp;<a href="https://n890gf.com/wp-content/uploads/2017/10/img_2265.jpg"><img src="https://n890gf.com/wp-content/uploads/2017/10/img_2265.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-611"></a>

With a dynafocal type 1 Mount, the bolts converge on the CG of the engine <i>when tightened. </i>This made it difficult to align everything initially until we tightened everything down.&nbsp;

<a href="https://n890gf.com/wp-content/uploads/2017/10/img_2267.jpg"><img width="960" height="1280" alt="" src="https://n890gf.com/wp-content/uploads/2017/10/img_2267.jpg" title="" class="alignnone size-full wp-image-612"></a>
Removing the hoist and letting it hang was one of the coolest things ever!&nbsp;

<a href="https://n890gf.com/wp-content/uploads/2017/10/img_2269.jpg"><img src="https://n890gf.com/wp-content/uploads/2017/10/img_2269.jpg" alt="" width="3264" height="2448" class="alignnone size-full wp-image-613"></a>
I got everything back into the garage and will begin installing some of the engine instrumentation and continue moving forward!&nbsp;
